import { Route, Switch } from 'react';

const Header = () => {
  <header>
    <Switch>
      <Route path="/">Top</Route>
      <Route path="/news">News</Route>
      <Route path="/about">About</Route>
    </Switch>
  </header>
}

export default Header;
